import {Container } from "./Components/index";
import { Header, Hero, Footer, MostPopular } from "./Components/Sections";

const App = () => {
  return (
    <>
      <Header />
      {/* the Container component will take a component as a children */}
      <Container>
            <Hero />
            <MostPopular/>
      </Container>
      <Footer />
    </>
  );
};

export default App;
